import React, { useState, useEffect } from "react";

const ResidentialRentForm = () => {
  /* ---------- 1. State ---------- */
  const [formData, setFormData] = useState({
    BhkType: "",
    Floor: "",
    HouseType: "",
    Parking: "",
    Terrace: "",
    Hall: "",
    Bedroom: "",
    Bathroom: "",
    District: "",
    Town: "",
    Street: "",
    ExpectedRent: "",
    ExpectedDepositMonths: "",
    ExpectedDeposit: "",
    Maintenance: "",
  });

  const [errors, setErrors] = useState({});

  /* ---------- 2. Static option lists ---------- */
  const options = {
    bhkTypes: ["1 RK", "1 BHK", "2 BHK", "3 BHK", "4 BHK", "4+ BHK"],
    floors: [
      "Ground Floor",
      "1 Floor",
      "2 Floor",
      "3 Floor",
      "4 Floor",
      "Above 4 Floor",
    ],
    houseTypes: ["Separate House", "Apartment", "Colony", "Joint Houses"],
    yesNo: ["Yes", "No"],
    halls: ["No Hall", "1", "2", "3+"],
    bedrooms: ["No Bedroom", "1", "2", "3+"],
    bathrooms: ["1", "2", "3+"],
    districts: ["Thoothukudi"],
    towns: ["Thoothukudi"],
    streets: ["Meenakshipuram", "Muthamil Nagar", "Periyasamy Colony"],
    depositMonths: Array.from({ length: 13 }, (_, i) => String(i)), // "0"‑"12"
    maintenance: ["Maintenance Include", "Maintenance Extra"],
  };

  /* ---------- 3. Helpers ---------- */
  const calculateDeposit = (rent, months) => {
    const r = Number(rent);
    const m = Number(months);
    return !isNaN(r) && !isNaN(m) ? r * m : "";
  };

  /** Validate required fields + positive numbers */
  const validate = (data) => {
    const required = [
      "BhkType",
      "Floor",
      "HouseType",
      "Parking",
      "Terrace",
      "Hall",
      "Bedroom",
      "Bathroom",
      "District",
      "Town",
      "Street",
      "ExpectedRent",
      "ExpectedDepositMonths",
      "Maintenance",
    ];

    const newErrors = {};

    required.forEach((field) => {
      if (!data[field]) newErrors[field] = "Required";
    });

    if (data.ExpectedRent && Number(data.ExpectedRent) <= 0) {
      newErrors.ExpectedRent = "Must be > 0";
    }
    if (
      data.ExpectedDepositMonths &&
      (Number(data.ExpectedDepositMonths) < 0 ||
        Number(data.ExpectedDepositMonths) > 12)
    ) {
      newErrors.ExpectedDepositMonths = "0‑12 only";
    }

    return newErrors;
  };

  /* ---------- 4. Side‑effect: recalc deposit ---------- */
  useEffect(() => {
    setFormData((prev) => ({
      ...prev,
      ExpectedDeposit: calculateDeposit(
        prev.ExpectedRent,
        prev.ExpectedDepositMonths
      ),
    }));
  }, [formData.ExpectedRent, formData.ExpectedDepositMonths]);

  /* ---------- 5. Event handlers ---------- */
  const handleChange = (e) => {
    const { name, value } = e.target;
    // clear error for the touched field
    setErrors((prev) => ({ ...prev, [name]: undefined }));
    // update data
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const validationErrors = validate(formData);
    setErrors(validationErrors);

    if (Object.keys(validationErrors).length) {
      alert("Please correct the highlighted errors.");
      return;
    }

    alert("Form submitted successfully! ✅");
    console.table(formData); // replace with real submit logic
  };

  /* ---------- 6. Reusable renderer ---------- */
  const renderSelect = (label, name, list) => (
    <div className="col-md-4 mb-3">
      <label>
        {label} <span className="text-danger">*</span>
      </label>
      <select
        name={name}
        className={`form-control ${errors[name] ? "is-invalid" : ""}`}
        value={formData[name]}
        onChange={handleChange}
      >
        <option value="">--Select--</option>
        {list.map((opt) => (
          <option key={opt} value={opt}>
            {opt}
          </option>
        ))}
      </select>
      {errors[name] && <div className="invalid-feedback">{errors[name]}</div>}
    </div>
  );

  /* ---------- 7. JSX ---------- */
  return (
    <div className="container-fluid">
      <form onSubmit={handleSubmit}>
        <h3 className="alert alert-warning">Residential Rent</h3>

        {/* ------------ Property Details ------------ */}
        <h4 className="alert alert-primary">Property Details</h4>
        <div className="row">
          {renderSelect("BHK Type", "BhkType", options.bhkTypes)}
          {renderSelect("Floor For Rent", "Floor", options.floors)}
        </div>

        <div className="row">
          {renderSelect("House Type", "HouseType", options.houseTypes)}
          {renderSelect("Parking", "Parking", options.yesNo)}
          {renderSelect("Terrace", "Terrace", options.yesNo)}
        </div>

        <div className="row">
          {renderSelect("Hall", "Hall", options.halls)}
          {renderSelect("BedRoom", "Bedroom", options.bedrooms)}
          {renderSelect("BathRoom", "Bathroom", options.bathrooms)}
        </div>

        {/* ------------ Locality Details ------------ */}
        <h4 className="alert alert-primary">Locality Details</h4>
        <div className="row">
          {renderSelect("District", "District", options.districts)}
          {renderSelect("Town", "Town", options.towns)}
          {renderSelect("Street", "Street", options.streets)}
        </div>

        {/* ------------ Rental Details ------------ */}
        <h4 className="alert alert-primary">Rental Details</h4>
        <div className="row">
          {/* Expected Rent */}
          <div className="col-md-6 mb-3">
            <label>
              Expected Rent <span className="text-danger">*</span>
            </label>
            <div className="input-group">
              <span className="input-group-text">₹</span>
              <input
                type="number"
                name="ExpectedRent"
                className={`form-control ${
                  errors.ExpectedRent ? "is-invalid" : ""
                }`}
                placeholder="Enter Amount"
                value={formData.ExpectedRent}
                onChange={handleChange}
                min="0"
              />
              <span className="input-group-text">/Month</span>
              {errors.ExpectedRent && (
                <div className="invalid-feedback d-block">
                  {errors.ExpectedRent}
                </div>
              )}
            </div>
          </div>

          {/* Deposit Months */}
          <div className="col-md-6 mb-3">
            <label>
              Expected Deposit Months <span className="text-danger">*</span>
            </label>
            <select
              name="ExpectedDepositMonths"
              className={`form-control ${
                errors.ExpectedDepositMonths ? "is-invalid" : ""
              }`}
              value={formData.ExpectedDepositMonths}
              onChange={handleChange}
            >
              <option value="">--Select--</option>
              {options.depositMonths.map((m) => (
                <option key={m} value={m}>
                  {m === "0" ? "No Deposit" : `${m} Month${m > 1 ? "s" : ""}`}
                </option>
              ))}
            </select>
            {errors.ExpectedDepositMonths && (
              <div className="invalid-feedback d-block">
                {errors.ExpectedDepositMonths}
              </div>
            )}
          </div>
        </div>

        {/* Expected Deposit (read‑only) */}
        <div className="row">
          <div className="col-md-6 mb-3">
            <label>Expected Deposit</label>
            <div className="input-group">
              <span className="input-group-text">₹</span>
              <input
                type="number"
                name="ExpectedDeposit"
                className="form-control"
                value={formData.ExpectedDeposit}
                readOnly
              />
            </div>
          </div>
        </div>

        {/* Maintenance */}
        <div className="row">
          {renderSelect("Monthly Maintenance", "Maintenance", options.maintenance)}
        </div>

        <hr />
        <button type="submit" className="btn btn-primary">
          Submit
        </button>
      </form>
    </div>
  );
};

export default ResidentialRentForm;
